import React, {useState} from 'react';
import { Menu } from 'antd';
import { 
  PlusSquareOutlined,
  ClockCircleOutlined, 
  SettingOutlined }
from '@ant-design/icons';
import { Input} from 'antd';
import { AudioOutlined } from '@ant-design/icons';

const {SubMenu} = Menu;
const { Search } = Input;

const suffix = (
  <AudioOutlined
    style={{
      fontSize: 16,
      color: '#1890ff',
    }}
  />
);

const onSearch = (value) => console.log(value);

const handleClick = () => {
//
}

const Navbar = () => {
  const [current,setCurrent]= useState('');
  return (
    <Menu onClick={handleClick} selectedKeys={[current]}
     mode="horizontal"  >
        <Menu.Item key='mail' icon={<PlusSquareOutlined />}/>
        <Menu.Item key='mail' icon={<ClockCircleOutlined />}/>
        <Search placeholder="input search text" onSearch={onSearch} enterButton />
    <Search
      placeholder="input search text"
      allowClear
      enterButton="Search"
      size="large"
      suffix={suffix}
      onSearch={onSearch}
    />

        <SubMenu
        key='subMenu'
        disable icon={<SettingOutlined/>}
        >

        </SubMenu>
        </Menu>
  )
}

export default Navbar;




